def msat_create_opt_env(conf=None, other=None):
    """
    Creates an optimizing environment.

    :param conf:  the input configuration.
    :param other: the sibling environment (if any) with
                  which to share terms; when present, the
                  sibling environment must be destroyed
                  only after the instance returned by this
                  method.

    :returns: a new msat_env instance; use MSAT_ERROR_ENV()
              to check for errors; free its resources with
              msat_destroy_env().
    """
    try:
        if conf is None:
            cfg = msat_create_config()
        elif hasattr(conf, 'items'):
            cfg = msat_create_config()
            for (k, v) in conf.items():
                msat_set_option(cfg, k, v)
        elif hasattr(conf, 'read'):
            cfg = _msat_parse_config(conf.read())
        else:
            try:
                cfg = conf + ""
            except:
                cfg = conf
            else:
                if '=' not in cfg:
                    cfg = msat_create_default_config(cfg)
                else:
                    cfg = msat_parse_config(cfg)
        if other is not None:
            return _msat_create_shared_opt_env(cfg, other)
        else:
            return _msat_create_opt_env(cfg)
    finally:
        if cfg is not conf:
            msat_destroy_config(cfg)

msat_create_shared_opt_env = msat_create_opt_env

def msat_destroy_opt_env(env):
    """
    Destroys an optimizing environment.
    This is an alias of msat_destroy_env().

    :param env: the msat_env instance to destroy.
    """
    msat_destroy_env(env)
    return

