def msat_set_opt_priority(env, priority):
    """
    Sets the multi-objective optimization priority to
    one of the supported algorithms:
    - "box": boxed/multi-independent optimization
    - "lex": lexicographic optimization
    - "par": pareto optimization

    :param env: the environment in which to operate.
    :param priority: the optimization priority

    :returns: zero on success, nonzero on error.
    """
    switcher = {
        "box" : 0,
        "lex" : 1,
        "par" : 2
    }
    return _msat_set_opt_priority(env, switcher[priority])


def msat_make_minimize(env, term, signed=False):
    """
    Creates a new objective 'min(term)'

    :param env: the environment in which to operate.
    :param term: the term to be minimized.
    :param signed: if 'term' is of Bit-Vector type, it is interpreted
                   as a signed Bit-Vector. Ignored otherwise.

    :returns: a msat_objective instance; use MSAT_ERROR_OBJECTIVE()
              to check for errors; free its resources with
              msat_destroy_objective().
    """
    if signed:
        return _msat_make_minimize_signed(env, term)
    else:
        return _msat_make_minimize(env, term)

def msat_make_maximize(env, term, signed=False):
    """
    Creates a new objective 'max(term)'

    :param env: the environment in which to operate.
    :param term: the term to be maximized.
    :param signed: if 'term' is of Bit-Vector type, it is interpreted
                   as a signed Bit-Vector. Ignored otherwise.

    :returns: a msat_objective instance; use MSAT_ERROR_OBJECTIVE()
              to check for errors; free its resources with
              msat_destroy_objective().
    """
    if signed:
        return _msat_make_maximize_signed(env, term)
    else:
        return _msat_make_maximize(env, term)

def msat_make_minmax(env, terms, signed=False):
    """
    Creates a new objective 'min(max(terms[0]), ..., max(terms[N]))'

    :param env: the environment in which to operate.
    :param terms: the list of terms subject to minmax.
    :param signed: if every 'term[i]' is of Bit-Vector type, then these
                   are interpreted as signed Bit-Vectors. Ignored otherwise.

    :returns: a msat_objective instance; use MSAT_ERROR_OBJECTIVE()
              to check for errors; free its resources with
              msat_destroy_objective().
    """
    if signed:
        return _msat_make_minmax_signed(env, len(terms), terms)
    else:
        return _msat_make_minmax(env, len(terms), terms)

def msat_make_maxmin(env, terms, signed=False):
    """
    Creates a new objective 'max(min(terms[0]), ..., min(terms[N]))'

    :param env: the environment in which to operate.
    :param terms: the list of terms subject to maxmin.
    :param signed: if every 'term[i]' is of Bit-Vector type, then these
                   are interpreted as signed Bit-Vectors. Ignored otherwise.

    :returns: a msat_objective instance; use MSAT_ERROR_OBJECTIVE()
              to check for errors; free its resources with
              msat_destroy_objective().
    """
    if signed:
        return _msat_make_maxmin_signed(env, len(terms), terms)
    else:
        return _msat_make_maxmin(env, len(terms), terms)

def msat_assert_objective(env, obj):
    """
    Pushes a msat_objective on the objective stack.

    :param env: the environment in which to operate.
    :param obj: the objective to assert.

    :returns: zero on success, nonzero on error.
    """
    return _msat_assert_objective(env, obj)

def msat_destroy_objective(env, obj):
    """
    Destroys a msat_objective.

    :param env: the environment in which the objective belongs.
    :param obj: the objective to destroy.
    """
    _msat_destroy_objective(env, obj)
    return

def msat_assert_soft_formula(env, cl, w, id):
    """
    Pushes the soft clause <cl, w>, which belongs to the
    MaxSMT/Pseudo-Boolean-Sum with identifier 'id', on
    the formula stack. If the identifier 'id' is not used,
    the soft clause has no effect. To set 'id' as a MaxSMT
    goal, the term obtained from msat_from_string(env, id)
    should be *explicitly* minimized.

    :param env: the environment in which to operate.
    :param cl: the soft clause.
    :param w: the weight associated with the soft-clause;
              it must be a msat_term with a constant
              numerical value.

    :returns: zero on success, nonzero on error.
    """
    return _msat_assert_soft_formula(env, cl, w, id)

###
### OBJECTIVE ITERATORS
###

def msat_create_objective_iterator(env):
    """
    Creates an iterator over the objectives currently
    asserted inside of the msat_env instance. An objective
    iterator is automatically invalidated by any action
    which alters the state of the objective stack.

    :param env: the msat_env instance.

    :returns: an objective iterator instance.
    """
    return _msat_create_objective_iterator(env)

def msat_objective_iterator_has_next(i):
    """
    Checks whether the iterator can be incremented.

    :param i: an objective iterator.

    :returns: nonzero if the iterator can be incremented,
              zero otherwise.
    """
    return _msat_objective_iterator_has_next(i)

def msat_objective_iterator_next(i):
    """
    Increments the objective iterator and returns the next objective
    in the stack.

    :param i: an objective iterator.

    :returns: a tuple (res, obj), where 'res' is nonzero
              in case of error and 'obj' is the next
              objective in the stack.
    """
    o = msat_objective()
    res = _msat_objective_iterator_next(i, o)
    return (res, o)

def msat_destroy_objective_iterator(i):
    """
    Destroys an objective iterator.

    :param i: an objective iterator.
    """
    _msat_destroy_objective_iterator(i)

###
### OBJECTIVE STATE INSPECTION
###

def msat_objective_result(env, obj):
    """
    Returns the optimization search state of the given
    objective, which can differ from that of the optimization
    search as a whole.

    :param env: the environment in which to operate.
    :param obj: the objective instance.

    :returns:
        MSAT_OPT_UNKNOWN: unable to determine SAT/UNSAT status.
        MSAT_OPT_UNSAT: objective is unsatisfiable.
        MSAT_OPT_SAT_PARTIAL: found some solution, but it has not
                              been certified to be optimal.
        MSAT_OPT_SAT_APPROX: found some solution which met early
                             termination criteria.
        MSAT_OPT_SAT_OPTIMAL: found a certified optimal solution.
    """
    return _msat_objective_result(env, obj)

def msat_objective_get_term(env, obj):
    """
    Returns the term wich is optimized by the objective.

    :param env: the environment in which to operate.
    :param obj: the objective instance.

    :returns: the msat_term instance being optimized.
    """
    return _msat_objective_get_term(env, obj)

def msat_objective_get_type(env, obj):
    """
    Returns the optimization type of the given objective.

    :param env: the environment in which to operate.
    :param obj: the objective instance.

    :returns:
        MSAT_OBJECTIVE_MINIMIZE: the objective is minimized.
        MSAT_OBJECTIVE_MAXIMIZE: the objective is maximized.
    """
    return _msat_objective_get_type(env, obj)

def msat_objective_get_search_stats(env, obj):
    """
    Returns the old-style optimization-search statistics.

    :param env: the environment in which to operate.
    :param obj: the objective instance.

    :returns: a string with statistics about the optimization
              search wrt. the input objective function.
    """
    return _msat_objective_get_search_stats(env, obj)

def msat_load_objective_model(env, obj):
    """
    Loads the objective model (if any) directly in the memory
    of the msat_env instance.

    :param env: the environment in which to operate.
    :param obj: the objective instance.

    :returns: zero on success, nonzero on error.
    """
    return _msat_load_objective_model(env, obj)

def msat_objective_get_model(env, obj):
    """
    Returns the model associated with the given objective,
    if any.

    :param env: the environment in which to operate.
    :param obj: the objective instance.

    :returns: a msat_model instance; use MSAT_ERROR_MODEL() to
              check for errors; dispose of the instance with
              msat_destroy_model().
    """
    return _msat_objective_get_model(env, obj)

###
### OBJECTIVE VALUE(s) INSPECTION
###

def msat_objective_value_is_unbounded(env, obj, val):
    """
    Determines if the given objective value is unbounded.

    :param env: the environment in which to operate.
    :param obj: the objective instance.
    :param val:
        MSAT_OPTIMUM: the final objective value.
        MSAT_FINAL_LOWER: the final lower bound.
        MSAT_FINAL_UPPER: the final upper bound.
        MSAT_FINAL_ERROR: the final absolute error.

    :returns: 1 if unbounded, 0 if not, -1 on error.
    """
    return _msat_objective_value_is_unbounded(env, obj, val)

def msat_objective_value_is_plus_inf(env, obj, val):
    """
    Determines if the given objective value is +inf.

    :param env: the environment in which to operate.
    :param obj: the objective instance.
    :param val:
        MSAT_OPTIMUM: the final objective value.
        MSAT_FINAL_LOWER: the final lower bound.
        MSAT_FINAL_UPPER: the final upper bound.
        MSAT_FINAL_ERROR: the final absolute error.

    :returns: 1 if +inf, 0 if not, -1 on error.
    """
    return _msat_objective_value_is_plus_inf(env, obj, val)

def msat_objective_value_is_minus_inf(env, obj, val):
    """
    Determines if the given objective value is -inf.

    :param env: the environment in which to operate.
    :param obj: the objective instance.
    :param val:
        MSAT_OPTIMUM: the final objective value.
        MSAT_FINAL_LOWER: the final lower bound.
        MSAT_FINAL_UPPER: the final upper bound.
        MSAT_FINAL_ERROR: the final absolute error.

    :returns: 1 if -inf, 0 if not, -1 on error.
    """
    return _msat_objective_value_is_minus_inf(env, obj, val)

def msat_objective_value_is_strict(env, obj, val):
    """
    Determines if the given objective value is strict. A value
        is said to be strict if it does not have an exact
        representation, i.e. V is strict if V = K +/- epsilon,
        where epsilon is some small positive value.

    :param env: the environment in which to operate.
    :param obj: the objective instance.
    :param val:
        MSAT_OPTIMUM: the final objective value.
        MSAT_FINAL_LOWER: the final lower bound.
        MSAT_FINAL_UPPER: the final upper bound.
        MSAT_FINAL_ERROR: the final absolute error.

    :returns: 1 if strict, 0 if not, -1 on error.
    """
    return _msat_objective_value_is_strict(env, obj, val)

def msat_objective_value_get_epsilon(env, obj, val):
    """
    Returns the sign of epsilon of the given objective
    value.

    :param env: the environment in which to operate.
    :param obj: the objective instance.
    :param val:
        MSAT_OPTIMUM: the final objective value.
        MSAT_FINAL_LOWER: the final lower bound.
        MSAT_FINAL_UPPER: the final upper bound.
        MSAT_FINAL_ERROR: the final absolute error.

    :returns:
         1 if the objective value is equal to K + epsilon
         0 if the objective value is not strict
        -1 if the objective value is equal to K - epsilon
    """
    return _msat_objective_value_get_epsilon(env, obj, val)

def msat_objective_value_term(env, obj, val, inf=None, eps=None):
    """
    Returns a term representing the given objective
    value. The OMT solver picks a suitable, finite,
    representation for any LIRA value lacking a finite
    representation (e.g. -oo/+oo and K +/- epsilon)
    using the input inf/eps arguments or, if not
    provided, some internal heuristics.

    :param env: the environment in which to operate.
    :param obj: the objective instance.
    :param val:
        MSAT_OPTIMUM: the final objective value.
        MSAT_FINAL_LOWER: the final lower bound.
        MSAT_FINAL_UPPER: the final upper bound.
        MSAT_FINAL_ERROR: the final absolute error.
    :param inf: a symbol or (large) positive value of rational
                type which represents infinity.
    :param eps: a symbol or (small) positive value of rational
                type which represents epsilon.

    :returns: a msat_term instance; use MSAT_CHECK_ERROR_TERM()
              to check for errors.
    """
    i = inf
    e = eps
    if i is None:
        i = MSAT_MAKE_ERROR_TERM()
    if e is None:
        e = MSAT_MAKE_ERROR_TERM()
    return _msat_objective_value_term(env, obj, val, i, e)






